import React from "react";
   import Slider from "react-slick";
   import "slick-carousel/slick/slick.css";
   import "slick-carousel/slick/slick-theme.css";
   
   const slides = [
     { image: "/images/h1.jpg" },
     { image: "/images/h2.jpg" },
     { image: "/images/h3.png" },
     { image: "/images/h4.jpg" },
     { image: "/images/h5.jpg" },
     { image: "/images/h6.jpg" },
   ];
   
   const Certificate = () => {
     const settings = {
       dots: false,
       infinite: true,
       speed: 500,
       slidesToShow: 4,
       slidesToScroll: 1,
       nextArrow: <SampleNextArrow />, 
       prevArrow: <SamplePrevArrow />,
       responsive: [
         {
           breakpoint: 1024,
           settings: {
             slidesToShow: 3,
           },
         },
         {
           breakpoint: 768,
           settings: {
             slidesToShow: 2,
           },
         },
         {
           breakpoint: 480,
           settings: {
             slidesToShow: 1,
           },
         },
       ],
     };
   
     return (
       <div className="w-full max-w-5xl mx-auto py-6">
         <Slider {...settings}>
           {slides.map((slide, index) => (
             <div key={index} className="p-2">
               <img src={slide.image} alt={`Slide ${index}`} className="w-full rounded-lg shadow-lg" />
             </div>
           ))}
         </Slider>
       </div>
     );
   };
   
   const SampleNextArrow = (props) => {
     const { onClick } = props;
     return (
       <div className="absolute top-1/2 right-2 transform -translate-y-1/2 text-white cursor-pointer z-10" onClick={onClick}>
         ➡
       </div>
     );
   };
   
   const SamplePrevArrow = (props) => {
     const { onClick } = props;
     return (
       <div className="absolute top-1/2 left-2 transform -translate-y-1/2 text-white cursor-pointer z-10" onClick={onClick}>
         ⬅
       </div>
     );
   };
   
   export default Certificate;
